def search_wallet_explorer(target_page_url,term):
    """Esegue una ricerca su WalletExplorer utilizzando il form di ricerca"""
    try:
        # Il form invia una GET request alla root con il parametro 'q'
        search_params = {'q': term}
        
        # Invia la richiesta GET con i parametri
        response = requests.get(target_page_url, params=search_params, headers=HEADERS)
        
        response.raise_for_status()
        
        # Controllo anti-bot
        if "blocked" in response.text.lower():
            print("ERRORE: Rilevata pagina di blocco. Interrompo lo scraping.")
            return None
        
        return response.text
    
    except requests.exceptions.RequestException as e:
        print(f"Errore durante la ricerca: {e}")
        return None

